import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Grid,
  Card,
  CardContent,
  Typography,
  Button,
  Stack,
  IconButton,
  Avatar,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import { motion } from "framer-motion";
import VisibilityIcon from "@mui/icons-material/Visibility";
import DownloadIcon from "@mui/icons-material/Download";
import InstagramIcon from "@mui/icons-material/Instagram";
import YouTubeIcon from "@mui/icons-material/YouTube";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import TwitterIcon from "@mui/icons-material/Twitter";
import "../styles/home.css";
import clgLogo from "../assets/CLG_LOGO.png";
import clubLogo from "../assets/clublogo.png";
import sympoLogo from "../assets/SYMPO.jpg";

const Home = () => {
  const navigate = useNavigate();
  const [social, setSocial] = useState({});
  const [clubInfo, setClubInfo] = useState({});

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/admin")
      .then((res) => {
        setSocial(res.data.socialLinks || {});
        setClubInfo(res.data.clubInfo || {});
      })
      .catch((err) => console.log(err));
  }, []);

  const options = [
    {
      title: "Register Now",
      description:
        "Join Innovation Ignite Symposium and be part of the creative tech community.",
      viewLink: "",
      downloadLink: "",
    },
    {
      title: "Symposium Rulebook",
      description:
        "View and download the symposium rulebook and event guidelines.",
      viewLink: "/symposium_upd.pdf",
      downloadLink: "/symposium_upd.pdf",
    },
    {
      title: "Quiz Competition",
      description: "Test your skills! Access the quiz competition rules here.",
      viewLink: "/upd_quiz_rb.pdf",
      downloadLink: "/upd_quiz_rb.pdf",
    },
    {
      title: "Mini Hackathon",
      description: "Solve real-world problems and unleash your creativity.",
      viewLink: "/upd_minihackathon.pdf",
      downloadLink: "/upd_minihackathon.pdf",
    },
    {
      title: "Model Presentation",
      description: "Showcase your innovative engineering model ideas.",
      viewLink: "/ModelRulebook.pdf",
      downloadLink: "/model_upd.pdf",
    },
  ];

  return (
    <div className="home-container">
      {/* Header Section */}
      <div className="home-header">
        <img src={clgLogo} alt="College Logo" className="college-logo" />
        <div className="logo-row">
          <img src={clubLogo} alt="Club Logo" className="round-logo" />
          <img src={sympoLogo} alt="Sympo Logo" className="round-logo" />
        </div>
        <Typography variant="h3" className="title">
          Innovation Ignite Symposium
        </Typography>
      </div>

      {/* News Section */}
      <motion.div
        className="news-section"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7, delay: 0.6 }}
      >
        <Typography variant="h5" gutterBottom sx={{ color: "#ff4c4c" }}>
          üîî Important News & Announcements
        </Typography>
        <div className="news-board">
          <Typography variant="body1">
            ‚Ä¢ Rulebook for Hackathon has been updated ‚Äî check the latest version.
          </Typography>
          <Typography variant="body1">
            ‚Ä¢ Registrations for Quiz close on <strong>Nov 9, 2025</strong>.
          </Typography>
          <Typography variant="body1">
            ‚Ä¢ Symposium event schedule will be published soon!
          </Typography>
        </div>
      </motion.div>

      {/* Option Cards Section */}
      <Grid container spacing={3} justifyContent="center" className="button-grid">
        {options.map((opt, i) => (
          <Grid item xs={10} sm={6} md={4} key={i}>
            <motion.div
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: i * 0.2, duration: 0.6 }}
            >
              <Card className="option-card">
                <CardContent>
                  <Typography variant="h5" gutterBottom>
                    {opt.title}
                  </Typography>
                  <Typography variant="body2" paragraph>
                    {opt.description}
                  </Typography>

                  {opt.viewLink && (
                    <Stack direction="row" justifyContent="center" spacing={2}>
                      <Button
                        variant="contained"
                        color="primary"
                        startIcon={<VisibilityIcon />}
                        onClick={() => window.open(opt.viewLink, "_blank")}
                        sx={{ borderRadius: "8px" }}
                      >
                        View
                      </Button>
                      {opt.downloadLink && (
                        <Button
                          variant="outlined"
                          color="primary"
                          startIcon={<DownloadIcon />}
                          component="a"
                          href={opt.downloadLink}
                          download
                          sx={{ borderRadius: "8px" }}
                        >
                          Download
                        </Button>
                      )}
                    </Stack>
                  )}
                </CardContent>
              </Card>
            </motion.div>
          </Grid>
        ))}
      </Grid>

      {/* üëá Social Media Card Section */}
      <motion.div
        className="social-card-section"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7, delay: 0.8 }}
        style={{ display: "flex", justifyContent: "center", marginTop: "2rem" }}
      >
        <Card
          sx={{
            width: 350,
            textAlign: "center",
            boxShadow: 5,
            borderRadius: "16px",
            backgroundColor: "#f4faff",
          }}
        >
          <CardContent>
            <Typography
              variant="h5"
              gutterBottom
              sx={{ fontWeight: "bold", color: "#007FFF" }}
            >
              üåê Social Media
            </Typography>

            {clubInfo.logoUrl && (
              <Avatar
                src={clubInfo.logoUrl}
                alt="Club Logo"
                sx={{
                  width: 80,
                  height: 80,
                  margin: "10px auto",
                  boxShadow: 3,
                }}
              />
            )}
            <Typography
              variant="subtitle1"
              sx={{ fontWeight: 600, color: "#007FFF", mb: 2 }}
            >
              {clubInfo.name || "Creative Codex"}
            </Typography>

            <Stack direction="row" justifyContent="center" spacing={2}>
              {social.instagram && (
                <IconButton component="a" href={social.instagram} target="_blank">
                  <InstagramIcon sx={{ color: "#E4405F" }} />
                </IconButton>
              )}
              {social.youtube && (
                <IconButton component="a" href={social.youtube} target="_blank">
                  <YouTubeIcon sx={{ color: "#FF0000" }} />
                </IconButton>
              )}
              {social.linkedin && (
                <IconButton component="a" href={social.linkedin} target="_blank">
                  <LinkedInIcon sx={{ color: "#0A66C2" }} />
                </IconButton>
              )}
              {social.twitter && (
                <IconButton component="a" href={social.twitter} target="_blank">
                  <TwitterIcon sx={{ color: "#1DA1F2" }} />
                </IconButton>
              )}
            </Stack>
          </CardContent>
        </Card>
      </motion.div>

      {/* Contact Section */}
      <motion.div
        className="contact-section"
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.7, delay: 0.9 }}
      >
        <Typography variant="h5" gutterBottom>
          Contact Us
        </Typography>
        <Typography>
          For any queries regarding registration, events, or participation, reach out to our team.
        </Typography>
        <Button
          variant="contained"
          color="primary"
          sx={{ mt: 2, borderRadius: "10px" }}
          onClick={() => navigate("/contact")}
        >
          Go to Contact Page
        </Button>
      </motion.div>

      {/* Admin Button */}
      <Button
        variant="contained"
        color="secondary"
        sx={{ mt: 3, borderRadius: "10px" }}
        onClick={() => (window.location.href = "/admin")}
      >
        Admin Login
      </Button>

      <footer>¬© 2025 Innovation Ignite Symposium | All Rights Reserved</footer>
    </div>
  );
};

export default Home;
